@Yoga with Adriene, I have noticed that my balance on my right side is very poor, I had to use the wall to balance myself,  and yet when I switched to my left side I was better..
 Is there anything special I can do to even up my poor balance? 
Thank you for offering this series, I am a 52 yr old Grandma starting with Yoga first time ever, and so far Im enjoying it.
